wwv_flow_api.create_plugin_attribute(
 p_id=>wwv_flow_api.id(53787152081609871301)
,p_plugin_id=>wwv_flow_api.id(53787151829688871299)
,p_attribute_scope=>'COMPONENT'
,p_attribute_sequence=>1
,p_display_sequence=>10
,p_prompt=>'ConfigJSON'
,p_attribute_type=>'TEXTAREA'
,p_is_required=>true
,p_default_value=>wwv_flow_string.join(wwv_flow_t_varchar2(
'{',
'   "type": "warning",',
'   "title": "Confirm",',
'   "text": "If you want to continue please enter %0",',
'   "showCancelButton": true,',
'   "input": "text",',
'   "inputAutoTrim": true,',
'   "inputPlaceholder": "",',
'   "inputRequiredInfo": "Value required",',
'   "inputNotDesiredValue": "Please enter the required value",',
'   "confirmButtonText": "Submit",',
'   "confirmButtonIcon": "fa-check",',
'   "cancelButtonText": "Cancel",',
'   "cancelButtonIcon": "fa-close",',
'   "focusCancel": true',
'}'))
,p_is_translatable=>true
,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<pre>',
'{',
'   "type": "warning",',
'   "title": "Confirm",',
'   "text": "If you want to continue please enter %0",',
'   "showCancelButton": true,',
'   "input": "text",',
'   "inputAutoTrim": true,',
'   "inputPlaceholder": "",',
'   "inputRequiredInfo": "Value required",',
'   "inputNotDesiredValue": "Please enter the required value",',
'   "confirmButtonText": "Submit",',
'   "confirmButtonIcon": "fa-check",',
'   "cancelButtonText": "Cancel",',
'   "cancelButtonIcon": "fa-close",',
'   "focusCancel": true',
'}',
'</pre>',
'<br>',
'<h3>Explanation:</h3>',
'  <dl>',
'  <dt>type (string)</dt>',
'  <dd>The type of the modal. SweetAlert2 comes with 5 built-in types which will show a corresponding icon animation: warning, error, success, info, and question. It can either be put in the array under the key "type" or passed as the third parameter '
||'of the function.</dd>',
'  <dl>',
'  <dt>title (string)</dt>',
'  <dd>The title of the modal, as HTML. It can either be added to the object under the key "title" or passed as the first parameter of the function.</dd>',
'  <dl>',
'  <dt>text (string)</dt>',
'  <dd>A description for the modal. It can either be added to the object under the key "text" or passed as the second parameter of the function. <b>The %0 will be replaced with the required value.</b></dd>',
'  <dl>',
'  <dt>showCancelButton (boolean)</dt>',
'  <dd>If set to true, a "Cancel"-button will be shown, which the user can click on to dismiss the modal.</dd>',
'  <dl>',
'  <dt>input (string)</dt>',
'  <dd>Input field type, can be text, email, password, number, tel, range, textarea, select, radio, checkbox, file and url.</dd>',
'  <dl>',
'  <dt>inputAutoTrim (boolean)</dt>',
'  <dd>Automatically remove whitespaces from both ends of a result string. Set this parameter to false to disable auto-trimming.</dd>',
'  <dl>',
'  <dt>inputPlaceholder (string)</dt>',
'  <dd>Input field placeholder.</dd>',
'  <dl>',
'  <dt>inputRequiredInfo (string)</dt>',
'  <dd>Shown info when try to submit with no input.</dd>',
'  <dl>',
'  <dt>inputNotDesiredValue (string)</dt>',
'  <dd>Shown if input does not compare to the required value.</dd>',
'  <dl>',
'  <dt>inputNotDesiredValue (string)</dt>',
'  <dd>Use this to change the text on the "Confirm"-button.</dd>',
'  <dl>',
'  <dt>confirmButtonIcon (string)</dt>',
'  <dd>Icon of the confirm button (Font Awesome or Font Apex).</dd>',
'  <dl>',
'  <dt>cancelButtonText (string)</dt>',
'  <dd>Use this to change the text on the "Cancel"-button.</dd>',
'  <dl>',
'  <dt>cancelButtonIcon (string)</dt>',
'  <dd>Icon of the cancel button (Font Awesome or Font Apex).</dd>',
'  <dl>',
'  <dt>focusCancel (boolean)</dt>',
'  <dd>Set to true if you want to focus the "Cancel"-button by default.</dd>',
'  <dl>'))
);
